import {
  Box,
  Divider,
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
} from "@mui/material";
import React from "react";
import CurrencyRubleIcon from '@mui/icons-material/CurrencyRuble';
import DiamondIcon from '@mui/icons-material/Diamond';
const DrawerList = (toggleDrawer) => {
  return (
    <Box
      sx={{ width: 250 }}
      role="presentation"
      onClick={() => toggleDrawer(false)}
    >
      <List sx={{mt: "25vh"}}>
      <Divider />
        {["Бренд", "Цена"].map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>
                
              <ListItemIcon>
                {index % 2 === 0 ? <CurrencyRubleIcon /> : <CurrencyRubleIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
      <Divider />
    </Box>
  );
};

export default DrawerList;
